import request from '@/utils/request'

const baseUrl = `/log/order/order`

export default {
    pageDisNewOrder(page, limit) {
        return request({
            url: `${baseUrl}/pageDisNewOrder/${page}/${limit}`,
            method: 'get'
        })
    }
}
